import React, { useState, useEffect }  from 'react';
import axios from "axios";
const Home = () => {
    const[initialData, setInitialData] =useState([{}])
    useEffect (() => {
        fetch('/getAllPastMovies').then(
            response => response.json()
        ).then(pastMovieData =>console.log(pastMovieData))
        fetch('/getAllPastTrendingMovies').then(
            response => response.json()
        ).then(data =>console.log(data))
        fetch('/topTenTrendingMoviesNow').then(
            response => response.json()
        ).then(data =>console.log(data))
        fetch('/topTenMoviesNow').then(
            response => response.json()
        ).then(data =>console.log(data))
    })

    }



export default Home;
